#include"leetcode.h"
using namespace std;
#define MAX 10001
class Solution {
private:
	int dp[MAX];
	bool cmpsort(const vector<int>& a, const vector<int>& b) {
		if (a[1] == b[1]) {
			return a[0] < b[0];
		}
		return a[1] < b[1];
	}
	bool cmpsort2(const int & a, const int & b) {
		if (courses[a][1] == courses[b][1]) {
			return courses[a][0] < courses[b][0];
		}
		return courses[a][1] < courses[b][1];
	}
	vector<vector<int>> courses;
	vector<int> cc;
public:
	int scheduleCourse(vector<vector<int>>& courses) {
		int n = courses.size();
		this->courses = courses;
		cc = vector<int>(n);
		for (int i = 0; i < n; i++) {
			cc[i] = i;
		}
		using std::placeholders::_1;
		using std::placeholders::_2;
		sort(cc.begin(), cc.end(), std::bind(&Solution::cmpsort2, this, _1, _2));
		for (int i = 0; i < MAX; i++)
		{
			dp[i] = 0;
		}
		int i, j;
		int left = 0;
		int right = 0;
		int index;
		int count = 0;
		for (i = 1; i <= n; i++) {
			index = cc[i - 1];
			right = min(courses[index][1], right + courses[index][0]);
			j = right;
			left = courses[index][1];
			while (j >= left) {
				dp[j] = max(dp[j], dp[j - 1]);
				dp[j] = max(dp[j], dp[j - courses[index][0]] + 1);
				j--;
				count++;
			}

		}
		int ans = 0;
		for (int i = 0; i < MAX; i++) {
			ans = max(ans, dp[i]);
		}
		return ans;
	}
};

